import ListItem from "./ListItem";
import { TodosContext } from "../App";

const List = () =>{
    const Todos = useContext(TodosContext);
    return(
        <div>
           {Todos.map(todo =>(
            <ListItem key={todo.id} id={todo.id} name={todo.name} description={todo.description}/>
           ))}
        </div>
    );
}

export default List;
